import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Card';
import 'tachyons';
import {robots} from './robots';


ReactDOM.render(
  <React.StrictMode>
   <div>
     <Card id={robots[0].id} name={robots[0].id}/>
     <Card />
     <Card />
     <Card />
     </div> 
  </React.StrictMode>,
  document.getElementById('root')
);

